import Header from "./NavComponents/navigation";
import bgVideo from "../images/bg.mp4";

const titleStyle = {
  display: "flex",
  flexDirection: "column",
  justifyContent: "center",
  alignItems: "flex-start",
  padding: "0px",
  gap: "6px",

  position: "absolute",
  width: "670px",
  height: "495px",
  left: "122px",
  top: "184px",
};

const bgStyle = {
  width: "100%",
  height: "100%",
  objectFit: "cover",
  position: "absolute",
  top: "0",
  left: "0",
  zIndex: "-999",
};

export default function Home() {
  return (
    <div>
      <Header />
      <div>
        <video
          src={bgVideo}
          style={bgStyle}
          autoplay="autoplay"
          loop="loop"
          muted="muted"
        ></video>

        <h2 id="button">Explore</h2>
      </div>
    </div>
  );
}

let backgroundStyle = document.getElementsByTagName("body");
backgroundStyle[0].style["background-color"] = "#F3F9FB";
